import {io} from 'socket.io-client'
const WS_URL = "ws://bt-21-playground-vppfc.ondigitalocean.app/"
import {usersUpdatedEvent} from "./check.observer"
import { IChannel } from './model.chat'


const socket = io(WS_URL)
export class View {
    private formContainer: HTMLElement | null
    private mainContainer: HTMLElement | null
    private inputValue: HTMLElement | null
    private regisBtn:HTMLElement | null
    private activeUsers:HTMLElement | null
    private channelContainer:HTMLElement |null
     constructor() {
        this.formContainer= document.querySelector(".modal-dialog")
        this.mainContainer = document.querySelector(".container-none")
        this.channelContainer = document.querySelector(".channel-container-none")

        this.inputValue = document.querySelector(".regis-input")
        this.regisBtn = document.querySelector(".btn")

        this.activeUsers = document.querySelector("#active-users")
        
    }
    renderChannels(arrOfChannels:IChannel[]) {
        const container = document.querySelector(".channel-container")
        arrOfChannels.forEach((elem) => {
            const channel = document.createElement("p")
            channel.classList.add("channel")
            channel.dataset.id = elem.id
            container?.append(channel)
            channel.textContent = `#${elem.title}`
        });  
    }

    renderUser(username:string | undefined) {
        const activeUser = document.createElement("p")
        if(username) {
            (activeUser as HTMLElement).textContent = username;
            activeUser.classList.add("active-user")
            this.activeUsers?.append(activeUser)
        }
        
        
    }
    renderUsersList(connectedUsers:object, users: string[]) {
        console.log(connectedUsers,users)
        // for(const [k,v] of Object.entries(connectedUsers))
        // let arr = Object.values(connectedUsers)
        // arr.forEach((n) => {
        //     if(n !== "Anonymous") {
        //         this.renderUser(n)
        //     }
        // })
    }  

    deleteDisconnectedUser(connectedUsers:object,socketId:string) {
        const arrOfUsers = document.querySelectorAll(".active-user")
        for(const [k,v] of Object.entries(connectedUsers)) {
            if(k === socketId) {
                for(let i = 0; i < arrOfUsers.length; i++) {
                    if(v === arrOfUsers[i].textContent) {
                        console.log(`user disconnect -> ${v},${arrOfUsers[i].textContent}`)
                        arrOfUsers[i].remove()
                    }
                }
            }
        }
    }
    bindRegisterMe(regisMe:(username:string| undefined) => void) {
        this.regisBtn?.addEventListener("click", () => {
            const myUserName = (this.inputValue as HTMLInputElement).value
            regisMe(myUserName)
            this.channelContainer?.classList.remove("channel-container-none")
            this.channelContainer?.classList.add("channel-container")
            this.formContainer?.remove() 
    })
}
    bindJoinChannel(callback:(ROOM_ID:string|undefined) => void) {
        this.channelContainer?.addEventListener('click', (event) => {
            if((event.target as HTMLElement).classList.contains("channel")) {
                const ROOM_ID = (event.target as HTMLElement).dataset.id
                callback(ROOM_ID)
                this.toggleClassChannels(ROOM_ID)
            }
        })
    }
    toggleClassChannels(ROOM_ID:string|undefined) {
        const channels = []
        for(let i = 1; i < 5; i++) {
            let c = document.querySelector(`#channel_${i}`)
            channels.push(c)
        }
        channels.forEach((channel) => {
            if(channel) {
                if(channel.id === `channel_${ROOM_ID}`) {
                    channel?.classList.remove("container-none")
                    channel?.classList.add("container")
                } else {
                    channel.classList.remove("container")
                    channel.classList.add("container-none")
                }
            }
        })
        
    }
}
